import Link from 'next/link'
import React from 'react'
import { makeStyles } from '@material-ui/core/styles'
import List from '@material-ui/core/List'
import Paper from '@material-ui/core/Paper'
import DoneOutlineIcon from '@material-ui/icons/DoneOutline'
import ListItem from '@material-ui/core/ListItem'
import ListItemIcon from '@material-ui/core/ListItemIcon'
import ListItemText from '@material-ui/core/ListItemText'
import VpnLockIcon from '@material-ui/icons/VpnLock'
import PublicIcon from '@material-ui/icons/Public'
import VerifiedUserIcon from '@material-ui/icons/VerifiedUser'
import RouterIcon from '@material-ui/icons/Router'
import CodeIcon from '@material-ui/icons/Code'
import FunctionsIcon from '@material-ui/icons/Functions'
import HttpsIcon from '@material-ui/icons/Https'
import GroupIcon from '@material-ui/icons/Group'
import ChatIcon from '@material-ui/icons/Chat';
import SearchIcon from '@material-ui/icons/Search'
import AccountBoxIcon from '@material-ui/icons/AccountBox'
import WorkIcon from '@material-ui/icons/Work'
import MapIcon from '@material-ui/icons/Map'
import VpnKeyIcon from '@material-ui/icons/VpnKey'
import HomeIcon from '@material-ui/icons/Home'
import SecurityIcon from '@material-ui/icons/Security'
import { Collapse } from '@material-ui/core'
import LockIcon from '@material-ui/icons/Lock'
import SupervisedUserCircleIcon from '@material-ui/icons/SupervisedUserCircle'
import SyncAltIcon from '@material-ui/icons/SyncAlt'
import WhatshotIcon from '@material-ui/icons/Whatshot'
import PeopleAltIcon from '@material-ui/icons/PeopleAlt'
import PlaylistAddCheckIcon from '@material-ui/icons/PlaylistAddCheck';
import GavelIcon from '@material-ui/icons/Gavel'
import LanguageIcon from '@material-ui/icons/Language'
import SupervisorAccountIcon from '@material-ui/icons/SupervisorAccount'
import AccountTreeIcon from '@material-ui/icons/AccountTree'
import AppsIcon from '@material-ui/icons/Apps'
import TrackChangesIcon from '@material-ui/icons/TrackChanges'
import SettingsInputComponentIcon from '@material-ui/icons/SettingsInputComponent'
import ListItemLink from './ListItemLink'
import BookIcon from '@material-ui/icons/Book';
import DescriptionIcon from '@material-ui/icons/Description';
import GitHubIcon from '@material-ui/icons/GitHub';
const useStyles = makeStyles(theme => ({
  root: {
    width: '100%',
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
    flexGrow: 1
  },
  nested: {
    paddingLeft: theme.spacing(4)
  }
}))

export default function PageLinks () {
  const classes = useStyles()

  return (
    <div className={classes.root}>
      <Paper elevation={0}>
        <List aria-label='navigation'>
          <ListItemLink to='/' primary='Home' icon={<HomeIcon />} />
          <ListItemLink to='/fortify' primary='Docs' icon={<BookIcon />} />
          <ListItemLink to='/fortify' primary='Slack' icon={<ChatIcon />} />
          <CollapsedNavigation heading='Resources' headingIcon={<AppsIcon />} routes={resourceRoutes} />
        </List>
      </Paper>
    </div>
  )
}

function CollapsedNavigation (props) {
  const { headingIcon, heading, routes } = props
  const [open, setOpen] = React.useState(true)
  const classes = useStyles()

  const handleClick = () => {
    setOpen(!open)
  }

  return (
    <>
      <ListItem button onClick={handleClick}>
        {headingIcon ? <ListItemIcon>{headingIcon}</ListItemIcon> : null}
        <ListItemText primary={heading} />
      </ListItem>
      <Collapse in={open} timeout='auto' unmountOnExit>
        <List component='div' disablePadding>
          {routes ? routes.map((route, index) =>
            <ListItemLink
              key={route.name + index}
              className={classes.nested}
              to={route.path}
              icon={route.icon()}
              primary={route.name}
            />) : null}
        </List>
      </Collapse>
    </>
  )
}

const resourceRoutes = [
  {
    path: '/cyberark/admin',
    name: 'Examples',
    icon: () => <PublicIcon />
  },
  {
    path: '/cyberark/admin',
    name: 'Blog',
    icon: () => <DescriptionIcon />
  },
  {
    path: '/cyberark/mappings/management/environment',
    name: 'Github',
    icon: () => <GitHubIcon />
  }

]
